import React from 'react';


const Tile = ({data}) => {
    return (
        <div>
            {data.map(i => 
                <>
                <div>{i.list_price.amount}</div>
                <img src={i.default_image_urls.main_image_url}/>
                </>
            )}
        </div>
    )
}

export default Tile;
